import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Disclaimer from './Disclaimer';
import Developer from './Developer';
import Faq from './Faq';

export default function Contactus() {
    return (
        <div className="contactus">
            <BrowserRouter>
                <button className = "dropdown-button" > Contact fi$pond </button>
                    <div className="dropd">
                        <Link to = "/disclaimer"><a href="" target="_blank" rel="norefererr">Disclaimer</a></Link>
                        <Link to = "/developer"><a href="" target="_blank" rel="norefererr">Developer?</a></Link>
                        <Link to = "/faq"><a href="" target="_blank" rel="norefererr">Customer Service</a></Link>
                    </div>

            </BrowserRouter>
        </div>    
    );
}
